import React, {Component} from "react";
import data from "./Network";

export default class Vis extends Component {
    componentDidMount() {
        data(this.props);
    }
    componentDidUpdate(prevProps) {
        data(this.props);
    }
    render() {
        return (
            <div className="vis"/>
        )
    }
}
